require.config({
    paths: {
        'eventDrops' : 'https://cdn.rawgit.com/marmelab/EventDrops/d55f8b001dc659eacef20edfec8b7159cffaa923/dist/eventDrops' // keep this at a version... not very nice but what can you do
    }
